import {React} from 'react';
import { Link } from 'react-router-dom';

import './Nav.css'


function Nav(props) {
  const { currentUser, handleLogout } = props;


return (
    <div className="nav">

        {
          currentUser ?
            <ul>
              <Link className="nav"to='/users'>Profile</Link>
              <Link className="nav"to='/posts'>Post Something?</Link>
              <p>{currentUser.username}</p>
              <Link className="nav" onClick={handleLogout}>Logout</Link>
            </ul>
            :
            <Link to='/login'>Login/Register</Link>

        }


    </div>
  )

}

export default Nav;
